import React from "react";

export default function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>Date</div>
      <div className="expense-item__description">
        <h2>Car Insurance</h2>
        <div className=".expense-item__price">$297.64</div>
      </div>
    </div>
  );
}
